Info:
----------
Cedar Cove is an American drama television series on the Hallmark Channel that began on July 20, 2013. Based on author Debbie Macomber's book series of the same name, Cedar Cove focuses on the Cedar Cove Municipal Court and revolves around Olivia Lockhart's professional and personal life. It is the network's first-ever original, scripted series.



Cast: Andie MacDowell
